import { useState } from 'react';
import React from 'react';

export default function GameBoard() {
    const defaultBoard = [
        [null, null, null],
        [null, null, null],
        [null, null, null]
    ];
    return (
        <ol id="game-board">
            {defaultBoard.map((row, rowIndex) => (
                <li key={rowIndex}>
                    <ol>
                        {row.map((player, colIndex) => (
                            <li key={colIndex}>
                                <button>{player}</button>
                            </li>
                        ))}
                    </ol>
                </li>
            ))}
        </ol>
    );
}
